// MainPage.js
import React from 'react';
import './MainPage.css';

const MainPage = () => {
  return (
    <div>
      <ul>
        <li><a href="templateMainPage.html"><i className="fa-solid fa-house-chimney"></i> Home</a></li>
        <li><a href="newspage.html"><i className="fa-solid fa-newspaper"></i> News</a></li>
        <li><a href="contactpage.html"><i className="fa-solid fa-paper-plane"></i> Contact</a></li>
        <li><a href="aboutpage.html"><i className="fa-solid fa-user"></i> About</a></li>
        <li><a href="game.html"><i className="fa-solid fa-user"></i> Games</a></li>
      </ul>

      <div>
        <div>
          <h1 className="center" style={{ font: 'bolder', fontSize: 'xx-large', fontFamily: 'serif' }}>
            Welcome to my page!
          </h1>
        </div>

        <svg id="svg" width="400" height="400" className="svg1">
          <defs>
            <linearGradient id="vert_yellow_red" x1="0%" y1="0%" x2="0%" y2="100%">
              <stop offset="0%" style={{ stopColor: 'rgb(78, 128, 93)', stopOpacity: 1 }} />
              <stop offset="100%" style={{ stopColor: 'rgb(0, 0, 0)', stopOpacity: 1 }} />
            </linearGradient>
          </defs>

          <image href="propicremovebg.png" height="400" width="400" useMap="#workmap" />
        </svg>
      </div>
    </div>
  );
};

export default MainPage;
